import React from 'react';
import Header from '../layouts/Header';

const ServiceDetail = () => {
  return (
    <div>
      <Header />
      <div className='container mt-5'>
      <div className='row mt-5'>
        <div className='col-md-12'>
          <h1>Service Detail</h1>
        </div>
      </div>
    </div>
    </div>    
  );
}

export default ServiceDetail;
